import React from 'react';
import { Bell, BookOpen, Home, MessageCircle, User, Search, Book, Briefcase, Plane, Award, HelpCircle, Globe2, ChevronRight } from 'lucide-react';
import { Card, CardContent } from '../components/ui/card';
import { Progress } from '../components/ui/progress';
import { Alert } from '../components/ui/alert';

const Dashboard = () => {
  const userData = {
    name: "Sarah",
    profileProgress: 60,
    applicationsSubmitted: 2,
    totalApplications: 5
  };

  const notifications = [
    "Your application to Stanford University needs transcript.",
    "MIT application is being reviewed.",
    "IELTS registration deadline approaching!"
  ];

  return (
    <div className="max-w-7xl mx-auto p-4 space-y-6">
      {/* Welcome Section */}
      <div className="bg-gradient-to-r from-blue-600 to-blue-800 rounded-lg p-6 text-white">
        <h1 className="text-2xl font-bold">Welcome back, {userData.name}! 🌏</h1>
        <div className="mt-4">
          <p className="text-sm">Profile Completion</p>
          <Progress value={userData.profileProgress} className="mt-2" />
          <p className="mt-2 text-sm">{userData.applicationsSubmitted}/{userData.totalApplications} Applications Submitted</p>
        </div>
        <div className="flex gap-3 mt-4">
          <button className="bg-white text-blue-600 px-4 py-2 rounded-lg text-sm font-medium">
            Continue Application
          </button>
          <button className="bg-blue-700 text-white px-4 py-2 rounded-lg text-sm font-medium">
            Upload Documents
          </button>
        </div>
      </div>

      {/* Search Bar */}
      <div className="relative">
        <Search className="absolute left-3 top-3 h-5 w-5 text-gray-400" />
        <input 
          type="text"
          placeholder="Search universities, courses, or scholarships..."
          className="w-full pl-10 pr-4 py-3 border rounded-lg"
        />
      </div>

      {/* Quick Access Grid */}
      <div className="grid grid-cols-2 md:grid-cols-4 gap-4">
        {[
          { icon: BookOpen, label: "Explore Universities" },
          { icon: Book, label: "Find Courses" },
          { icon: Briefcase, label: "Track Applications" },
          { icon: Award, label: "Scholarships" },
        ].map((item, i) => (
          <Card key={i} className="hover:shadow-lg transition-shadow">
            <CardContent className="p-4 flex flex-col items-center justify-center">
              <item.icon className="h-8 w-8 text-blue-600 mb-2" />
              <span className="text-sm font-medium text-center">{item.label}</span>
            </CardContent>
          </Card>
        ))}
      </div>

      {/* Notifications */}
      <div className="space-y-3">
        {notifications.map((notification, i) => (
          <Alert key={i} className="flex items-center justify-between">
            <p className="text-sm">{notification}</p>
            <ChevronRight className="h-5 w-5" />
          </Alert>
        ))}
      </div>

      {/* Bottom Navigation */}
      <div className="fixed bottom-0 left-0 right-0 bg-white border-t px-6 py-3">
        <div className="flex justify-between max-w-7xl mx-auto">
          {[
            { icon: Home, label: "Home" },
            { icon: BookOpen, label: "Courses" },
            { icon: MessageCircle, label: "Chat" },
            { icon: User, label: "Profile" },
          ].map((item, i) => (
            <button key={i} className="flex flex-col items-center">
              <item.icon className="h-6 w-6 text-gray-600" />
              <span className="text-xs mt-1">{item.label}</span>
            </button>
          ))}
        </div>
      </div>

      {/* Language Selector */}
      <div className="fixed top-4 right-4 flex items-center gap-2">
        <Globe2 className="h-5 w-5" />
        <select className="border rounded-md text-sm px-2 py-1">
          <option>English</option>
          <option>Nepali</option>
        </select>
      </div>

      {/* Floating Help Button */}
      <button className="fixed bottom-20 right-4 bg-blue-600 text-white rounded-full p-3 shadow-lg">
        <HelpCircle className="h-6 w-6" />
      </button>
    </div>
  );
};

export default Dashboard;
